import { createRouter } from 'vue-router'

import SomethingBeautiful from '../components/SomethingBeautiful.vue'

const routes = [
  { path: '/', name: 'HomeScreen', component: SomethingBeautiful }
]

const router = createRouter({
  routes
})

export default router
